def sequentialDigits(low, high):
    queue = [i for i in range(1, 10)]
    res = []
    while queue:
        i = queue.pop(0)
        if low < i <= high:
            res.append(i)
        if i % 10 + 1 < 10:
            queue.append(i * 10 + i % 10 + 1)
    res.sort()
    return (res, len(res))

